import React, {useState} from "react";
import './EventDay.scss';
import ToggleBtn from "../ToggleBtn/ToggleBtn";

export default function EventDay() {
    const [status, setStatus] = useState(false)
    const [toggle, setToggle] = useState(null)

    function saveStatus (){
        setStatus(toggle)
    }
    return (
        <>
            <div className="EventDay">
                <h1>Event Day</h1>
                <div className="attendance">
                    <div className="card">
                        <div className="top-icons">
                            <span className="fas fa-user"></span>
                            <span className="fas fa-check" onClick={saveStatus}></span>
                        </div>
                        <img src="https://likhowithpride.com/site/assets/files/1108/opulent-profile-square-07.jpg" alt="" />
                        <h6>Amruth Todkar</h6>
                        <ToggleBtn toggle={toggle} setToggle={setToggle} />
                    </div>
                </div>
            </div>
        </>
    )
}
